import React, { useState, useEffect } from 'react';
import Select from 'react-select';
import { useAuth } from '../../context/AuthContext';
import axios from 'axios';

const Tasks = () => {
  const { user } = useAuth();
  const [tasks, setTasks] = useState([]);
  const [technicians, setTechnicians] = useState([]);
  const [equipment, setEquipment] = useState([]);
  const [selectedTechnician, setSelectedTechnician] = useState(null);
  const [selectedEquipment, setSelectedEquipment] = useState(null);
  const [loadingTech, setLoadingTech] = useState(false);
  const [loadingEquip, setLoadingEquip] = useState(false);

  // Fetch tasks (existing logic can be kept or extended)
  useEffect(() => {
    axios.get('/api/tasks')
      .then(res => setTasks(res.data))
      .catch(err => console.error('Error fetching tasks:', err));
  }, []);

  // Live search technicians
  const fetchTechnicians = async (inputValue) => {
    setLoadingTech(true);
    try {
      const res = await axios.get(`/api/users/preapproved/technicians?search=${inputValue}`);
      const options = res.data.map(tech => ({
        value: tech._id,
        label: `${tech.name} (${tech.serviceNumber})`
      }));
      setTechnicians(options);
    } catch (error) {
      console.error('Error fetching technicians:', error);
    } finally {
      setLoadingTech(false);
    }
  };

  // Live search equipment
  const fetchEquipment = async (inputValue) => {
    setLoadingEquip(true);
    try {
      const res = await axios.get(`/api/equipment?search=${inputValue}`);
      const options = res.data.equipment.map(eq => ({
        value: eq._id,
        label: `${eq.name} - ${eq.model} (${eq.serialNumber})`
      }));
      setEquipment(options);
    } catch (error) {
      console.error('Error fetching equipment:', error);
    } finally {
      setLoadingEquip(false);
    }
  };

  const handleAssignTask = () => {
    if (!selectedTechnician || !selectedEquipment) {
      alert('Please select both technician and equipment');
      return;
    }
    // Example POST request for assigning task
    axios.post('/api/tasks/assign', {
      technicianId: selectedTechnician.value,
      equipmentId: selectedEquipment.value
    })
      .then(res => {
        alert('Task assigned successfully');
      })
      .catch(err => {
        console.error('Error assigning task:', err);
        alert('Failed to assign task');
      });
  };

  return (
    <div className="tasks-container">
      <h2>Tasks</h2>

      {/* Assign Task section — only Admin & Engineer */}
      {(user?.role === 'Admin' || user?.role === 'Engineer') && (
        <div className="assign-task-section">
          <h3>Assign Task</h3>
          <div className="form-group">
            <label>Select Technician</label>
            <Select
              isClearable
              isLoading={loadingTech}
              options={technicians}
              onInputChange={fetchTechnicians}
              onChange={setSelectedTechnician}
              placeholder="Search technicians..."
            />
          </div>

          <div className="form-group">
            <label>Select Equipment</label>
            <Select
              isClearable
              isLoading={loadingEquip}
              options={equipment}
              onInputChange={fetchEquipment}
              onChange={setSelectedEquipment}
              placeholder="Search equipment..."
            />
          </div>

          <button className="btn btn-primary" onClick={handleAssignTask}>
            Assign
          </button>
        </div>
      )}

      {/* Task list */}
      <div className="task-list">
        <h3>All Tasks</h3>
        {tasks.length === 0 ? (
          <p>No tasks available</p>
        ) : (
          <ul>
            {tasks.map(task => (
              <li key={task._id}>
                {task.title} — Assigned to: {task.technician?.name || 'Unassigned'}
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default Tasks;
